import pkg_id from "@iota/identity-wasm/node/index.js";
const {
    EdDSAJwsVerifier,
    FailFast,
    Jwt,
    JwtCredentialValidationOptions,
    JwtCredentialValidator,
} = pkg_id;

import { iotaResolution } from './resolveDID.js';

export async function validateVC(credentialJwtString){

    try {
        const credentialJwt = new Jwt(credentialJwtString);
        const issuerDID = process.env.DID_ISSUER;
        const issuerDocument = await iotaResolution(issuerDID);
        const res = new JwtCredentialValidator(new EdDSAJwsVerifier()).validate(
            credentialJwt,
            issuerDocument,
            new JwtCredentialValidationOptions(),
            FailFast.FirstError,
        );
        const document = res.intoCredential().toJSON();
        const did = JSON.stringify(document.credentialSubject.id);
        const photo = JSON.stringify(document.credentialSubject.Photo);
        return ({did: did, photo: photo});

    } catch (error){
        console.log(error);
    }
}

